import { Button, Card, CardContent, CircularProgress, Grid, TextField, Typography } from '@mui/material'
import { useState, useEffect } from 'react'
import { useNavigate, useParams } from 'react-router-dom'

export default function NewMedidor() {
    const [task, setTask] = useState({
        rut: '',
        codigo: '',
        nombre: '',
        fecha_creacion: '',
        descripcion: '',
    });

    const [loading, setLoading] = useState(false);
    const [editing, setEditing] = useState(false);

    const navigate = useNavigate();
    const params = useParams();

    // Implementa el useEffect para obtener el valor del rut correspondiente a la ID del cliente seleccionado
    useEffect(() => {
        if (params.id) {
            fetch(`http://localhost:4000/rut/${params.id}`)
                .then((response) => response.json())
                .then((data) => {
                    setTask({ ...task, rut: data.rut });
                })
                .catch((error) => {
                    console.error("Error al obtener el rut:", error);
                });
        }
    }, [params.id]);

    const handleSubmit = async (e) => {
        e.preventDefault();
        setLoading(true);

        if (editing) {
            await fetch(`http://localhost:4000/medidores/${params.id}`, {
                method: 'PUT',
                headers: {
                    "Content-Type": "application/json",
                },
                body: JSON.stringify(task),
            });
        } else {
            await fetch('http://localhost:4000/medidores', {
                method: 'POST',
                body: JSON.stringify(task),
                headers: { 'Content-Type': 'application/json' },
            });
        }

        setLoading(false);
        navigate('/');
    };

    const handleChange = (e) => setTask({ ...task, [e.target.name]: e.target.value });

    return (
        <Grid container direction="column" alignItems="center" justifyContent="center">
            <Grid item xs={3}>
                <Card sx={{ mt: 5 }} style={{ backgroundColor: '#1e272e', padding: '1rem' }}>
                    <Typography variant="h5" textAlign="center" color="white">
                        {editing ? "Editar" : "Agregar"}
                    </Typography>
                    <CardContent>
                        <form onSubmit={handleSubmit}>
                            <TextField
                                name="rut"
                                value={task.rut}
                                variant="filled"
                                label="Rut"
                                sx={{ display: 'block', margin: '.5rem 0' }}
                                onChange={handleChange}
                                inputProps={{ style: { color: 'white' } }}
                                InputLabelProps={{ style: { color: 'white' } }}
                            />
                            <TextField
                                name="codigo"
                                value={task.codigo}
                                variant="filled"
                                label="Código"
                                sx={{ display: 'block', margin: '.5rem 0' }}
                                onChange={handleChange}
                                inputProps={{ style: { color: 'white' } }}
                                InputLabelProps={{ style: { color: 'white' } }}
                            />
                            <TextField
                                name="nombre"
                                value={task.nombre}
                                variant="filled"
                                label="Nombre"
                                sx={{ display: 'block', margin: '.5rem 0' }}
                                onChange={handleChange}
                                inputProps={{ style: { color: 'white' } }}
                                InputLabelProps={{ style: { color: 'white' } }}
                            />
                            <TextField
                                name="fecha_creacion"
                                value={task.fecha_creacion}
                                type="date"
                                variant="filled"
                                label="Fecha de Creación"
                                sx={{ display: 'block', margin: '.5rem 0' }}
                                onChange={handleChange}
                                inputProps={{ style: { color: 'white' } }}
                                InputLabelProps={{ style: { color: 'white' } }}
                            />
                            <TextField
                                name="descripcion"
                                value={task.descripcion}
                                variant="filled"
                                label="Descripción"
                                multiline
                                rows={4}
                                sx={{ display: 'block', margin: '.5rem 0' }}
                                onChange={handleChange}
                                inputProps={{ style: { color: 'white' } }}
                                InputLabelProps={{ style: { color: 'white' } }}
                            />
                            <Button
                                variant="contained"
                                color="primary"
                                type="submit"
                                disabled={!task.codigo || !task.nombre || !task.fecha_creacion}
                            >
                                {loading ? (
                                    <CircularProgress color="inherit" size={24} />
                                ) : (
                                    'Guardar'
                                )}
                            </Button>
                        </form>
                    </CardContent>
                </Card>
            </Grid>
        </Grid>
    );
}
